Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# Import necessary functions from user32.dll for window dragging
Add-Type @"
    using System;
    using System.Runtime.InteropServices;

    public class User32 {
        [DllImport("user32.dll")]
        public static extern bool ReleaseCapture();
        
        [DllImport("user32.dll")]
        public static extern IntPtr SendMessage(IntPtr hWnd, int Msg, int wParam, int lParam);
    }
"@

# Constants for window dragging
$WM_NCLBUTTONDOWN = 0xA1
$HTCAPTION = 0x2

$IconBase64 = ""
$IconBytes = [Convert]::FromBase64String($IconBase64)
$ims = New-Object IO.MemoryStream($IconBytes, 0, $IconBytes.Length)
$ims.Write($IconBytes, 0, $IconBytes.Length)

# Create the form
$form = New-Object System.Windows.Forms.Form
$form.Text = ""
#$form.Size = New-Object System.Drawing.Size(148, 178)
$form.Icon = [System.Drawing.Icon]::FromHandle((New-Object System.Drawing.Bitmap -Argument $ims).GetHIcon())
$form.TopMost = $true
$form.StartPosition = "CenterScreen"
$form.FormBorderStyle = 'None'  # Remove the border
$form.BackColor = [System.Drawing.Color]::DimGray  # Set the form's background color
$form.TransparencyKey = $form.BackColor  # Make the background color transparent
$form.AllowDrop = $true

# Create PictureBox to hold the GIF
$pictureBox = New-Object System.Windows.Forms.PictureBox
$pictureBox.SizeMode = "StretchImage"
$pictureBox.Dock = "None"
#$pictureBox.Size = New-Object System.Drawing.Size(128, 128)
$pictureBox.BackColor = [System.Drawing.Color]::Transparent

# Base64 encoded GIF
$base64String = ""
$imageBytes = [Convert]::FromBase64String($base64String)
$memoryStream = New-Object System.IO.MemoryStream(, $imageBytes)
$loadedImage = [System.Drawing.Image]::FromStream($memoryStream)
$pictureBox.Image = $loadedImage

# Add PictureBox to the form
$form.Controls.Add($pictureBox)

# Set the initial size of the PictureBox to match the original image size
$pictureBox.Image = $loadedImage
$pictureBox.Size = $loadedImage.Size

# Set the form size to match the image size
$form.Size = $loadedImage.Size

# Add PictureBox to the form
$form.Controls.Add($pictureBox)

# Adjust PictureBox size and location on form resize
$form.Add_Resize({
        $pictureBox.Size = $form.ClientSize
        $pictureBox.Location = New-Object System.Drawing.Point(0, 0)
    })

# Add MouseDown event to the PictureBox to enable dragging
$pictureBox.Add_MouseDown({
        [User32]::ReleaseCapture() | Out-Null
        [User32]::SendMessage($form.Handle, $WM_NCLBUTTONDOWN, $HTCAPTION, 0) | Out-Null
    })

# Add MouseWheel event to resize the form
# Modify MouseWheel event to handle form resizing and opacity adjustment when holding 'Ctrl'
$form.Add_MouseWheel({
        param($sender, $e)

        # Check if the 'Ctrl' key is being held down
        if ([System.Windows.Forms.Control]::ModifierKeys -eq [System.Windows.Forms.Keys]::Control) {
            # Adjust the form's opacity (opacity is a value between 0.0 and 1.0)
            $change = 0.05  # Change opacity by 5%
            $newOpacity = $form.Opacity + ($e.Delta / [Math]::Abs($e.Delta)) * $change

            # Ensure opacity is within valid bounds (0.1 to 1.0)
            if ($newOpacity -lt 0.1) { $newOpacity = 0.1 }
            if ($newOpacity -gt 1.0) { $newOpacity = 1.0 }

            # Apply the new opacity to the form
            $form.Opacity = $newOpacity
        }
        else {
            # Normal resizing when 'Ctrl' is not pressed
            $change = 20  # Change size by 20 pixels per scroll
            $newWidth = $form.ClientSize.Width + ($e.Delta / [Math]::Abs($e.Delta)) * $change
            $newHeight = $form.ClientSize.Height + ($e.Delta / [Math]::Abs($e.Delta)) * $change

            # Enforce minimum size to avoid shrinking too small
            $minSize = [System.Drawing.Size]::new(100, 100)
            if ($newWidth -lt $minSize.Width) { $newWidth = $minSize.Width }
            if ($newHeight -lt $minSize.Height) { $newHeight = $minSize.Height }

            # Resize both form and PictureBox based on new dimensions
            $form.ClientSize = [System.Drawing.Size]::new($newWidth, $newHeight)
            $pictureBox.Size = [System.Drawing.Size]::new($newWidth, $newHeight)
        }
    })

